  true,\n\t\"url\": null,\n\t\"notes\": \"Air Emissions provides (1) interactive charts
  supporting national, state, or county charts, (2) county maps of criteria air pollutant
  emissions for a state, and (3) a Where You Live facility mapping feature.  All data
  included in this resource are based based on the latest National Emissions Inventory
  (NEI).   The interactive charts display national or user-defined state or county
  total emissions by emissions source sectors and allow users to further explore subcategories
  of emissions by clicking on links below the charts.  Interactive charts for multi-pollutant
  displays are also available at national, state, and county levels.  All chart data
  can be downloaded.  The county maps are updated based on the selected state and
  \ pollutant.  The Where You Live facility maps allow users to select a crtieria
  pollutant, a state, and industry categories and create maps.  A KMZ file of the
  map can also be created.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
